import axios from "axios";

const token = localStorage.getItem('token');

const api = axios.create({
  baseURL: 'https://localhost:4000',
  headers: {
    'Access-Control-Allow-Origin': '*',
    'Content-Type': 'application/json',
    'Authorization': token
  }
})

export default api;
